import React, { useState } from 'react';

/**
 * A modal component for adding a new activity to a travel itinerary.
 * The modal uses Tailwind CSS for styling, mimicking the provided image.
 *
 * @param {object} props - Component props
 * @param {boolean} props.isOpen - Controls the visibility of the modal.
 * @param {function} props.onClose - Function to call when the modal is closed.
 * @param {function} props.onAddActivity - Function to handle the activity submission.
 */
const AddNewActivityModal = ({ isOpen, onClose, onAddActivity }) => {
  // If the modal is not open, don't render anything
  if (!isOpen) return null;

  // Basic state to hold form data (Optional: can be managed by parent/context)
  const [activityData, setActivityData] = useState({
    name: '',
    description: '',
    time: '',
    category: '',
    location: '',
  });

  // Handle input changes
  const handleChange = (e) => {
    const { name, value } = e.target;
    setActivityData(prevData => ({
      ...prevData,
      [name]: value,
    }));
  };

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();
    // Simple validation: check if required fields are filled
    if (activityData.name && activityData.location) {
      onAddActivity(activityData);
      setActivityData({
        name: '',
        description: '',
        time: '',
        category: '',
        location: '',
      });
    } else {
      alert('Please fill in all required fields (*)');
    }
  };

  return (
    // Backdrop and Modal Container
    <div className="fixed inset-0 z-50 flex items-center justify-center bg-gray-900 bg-opacity-50 backdrop-blur-sm p-4">
      {/* Modal Content Area */}
      <div className="bg-white rounded-lg shadow-2xl w-full max-w-md mx-auto">
        
        {/* Modal Header */}
        <div className="flex items-center justify-between p-4 border-b border-gray-200">
          <h3 className="text-xl font-semibold text-gray-800">
            Add New Activity
          </h3>
          <button
            onClick={onClose}
            className="text-gray-400 hover:text-gray-600 transition duration-150"
            aria-label="Close modal"
          >
            {/* Simple X icon */}
            <svg
              className="w-6 h-6"
              fill="none"
              stroke="currentColor"
              viewBox="0 0 24 24"
              xmlns="http://www.w3.org/2000/svg"
            >
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth="2"
                d="M6 18L18 6M6 6l12 12"
              ></path>
            </svg>
          </button>
        </div>

        {/* Modal Body / Form */}
        <form className="p-6" onSubmit={handleSubmit}>
          
          {/* Activity Name */}
          <div className="mb-4">
            <label htmlFor="activityName" className="block text-sm font-medium text-gray-700 mb-1">
              Activity Name*
            </label>
            <input
              type="text"
              id="activityName"
              name="name"
              value={activityData.name}
              onChange={handleChange}
              placeholder=""
              className="w-full px-3 py-2 border border-gray-300 rounded-md bg-gray-200 placeholder-gray-400 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
              required
            />
          </div>

          {/* Description */}
          <div className="mb-4">
            <label htmlFor="description" className="block text-sm font-medium text-gray-700 mb-1">
              Description
            </label>
            <textarea
              id="description"
              name="description"
              value={activityData.description}
              onChange={handleChange}
              rows="2"
              placeholder=""
              className="w-full px-3 py-2 border border-gray-300 rounded-md bg-gray-200 placeholder-gray-400 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500 resize-none"
            ></textarea>
          </div>

          {/* Time and Category (Side-by-side) */}
          <div className="flex space-x-4 mb-4">
            <div className="flex-1">
              <label htmlFor="time" className="block text-sm font-medium text-gray-700 mb-1">
                Time
              </label>
              <input
                type="text" // Could be type="time" but using text for visual match
                id="time"
                name="time"
                value={activityData.time}
                onChange={handleChange}
                placeholder=""
                className="w-full px-3 py-2 border border-gray-300 rounded-md bg-gray-200 placeholder-gray-400 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
              />
            </div>
            <div className="flex-1">
              <label htmlFor="category" className="block text-sm font-medium text-gray-700 mb-1">
                Catagory
              </label>
              <input
                type="text"
                id="category"
                name="category"
                value={activityData.category}
                onChange={handleChange}
                placeholder=""
                className="w-full px-3 py-2 border border-gray-300 rounded-md bg-gray-200 placeholder-gray-400 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
              />
            </div>
          </div>

          {/* Location */}
          <div className="mb-6">
            <label htmlFor="location" className="block text-sm font-medium text-gray-700 mb-1">
              Location*
            </label>
            <input
              type="text"
              id="location"
              name="location"
              value={activityData.location}
              onChange={handleChange}
              placeholder=""
              className="w-full px-3 py-2 border border-gray-300 rounded-md bg-gray-200 placeholder-gray-400 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
              required
            />
          </div>

          {/* Footer Buttons */}
          <div className="flex justify-end space-x-3">
            <button
              type="button"
              onClick={onClose}
              className="px-6 py-2 text-gray-700 bg-gray-300 rounded-md hover:bg-gray-400 transition duration-150 font-medium"
            >
              Cancel
            </button>
            <button
              type="submit"
              className="px-6 py-2 text-white bg-black rounded-md hover:bg-gray-800 transition duration-150 font-medium"
            >
              Add Activity
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default AddNewActivityModal;
